import React from "react";
import "./CheckOut.scss";

const CheckOut = () => {
  return (
    <div className="checkout-page">
      <div className="header">
        <div className="header-component">
          <span>Product</span>
        </div>
        <div className="header-component">
          <span>Description</span>
        </div>
        <div className="header-component">
          <span>Quantity</span>
        </div>
        <div className="header-component">
          <span>Price</span>
        </div>
        <div className="header-component">
          <span>Remove</span>
        </div>
      </div>
    </div>
  );
};

export default CheckOut;
